        [11] = "%s asub %s, edendab finantskirjaoskust noorte seas ja inspireerib järgmist põlvkonda teadlikke investoreid. Pühendumusega finantsharidusele ja aastatepikkuse kogemusega see finantspedagoog, vanus *, võimestab noori tegema teadlikke finantsotsuseid.",
